//map 함수 사용할 때 : 박스 별로 키 값을 부여->고유한 값으로 식별 가능
import React from 'react';
import detail from "./data/productDetail.js"
import "./Boxb.css"
import LikeButton from "./LikeButton";
import ProductDetail from './pages/ProductDetail';

import {BrowserRouter as Router, Route, Routes, useNavigate} from 'react-router-dom'

import {
    StyledBox,
    TextContainer,
    ProdName,
    ProdAddress,
    ProdPrice,
} from "./styled"



const Boxb = () => {
    const navigate = useNavigate();
    const handleClick =(url) => {
        navigate(url);
    };

    return <>{detail.detailProd.map((product)=>(
        <>
            <StyledBox key={product.id}>
                <Router>
                <Routes>
                    <Route 
                    path="/"
                    element={
                        <>
                        <img src={product.img} alt="imag" 
                        onClick={()=>handleClick('/detail:detailID')}></img>
                        <ProdName><b>{product.title}</b></ProdName>
                        <ProdAddress className="address"> {product.address}</ProdAddress>
                        <TextContainer>
                            <ProdPrice className="price"> {product.price}</ProdPrice>
                            <LikeButton />
                        </TextContainer>
                        </>}></Route>

                    <Route
                        path='detail/:detailID'
                        element={<ProductDetail></ProductDetail>}>
                    </Route>

                    </Routes>
                </Router>


            </StyledBox>
        </>
        ))}
        </>

};

export default Boxb
